import React, { useState, useEffect } from 'react';
import email from './image/email.png';
import linkedin from './image/likedin.png';
import github from './image/github.png';
import facebook from './image/Facebook.png';
import instagram from './image/instagram.png';

const styles = {
  mainContent: {
    backgroundColor: '#171717',
    color: '#aaa',
    textAlign: 'center',
    padding: '2rem',
    minHeight: '100vh',
    position: 'relative',
    overflow: 'hidden',
  },
  logoContainer: {
    display: 'flex',
    justifyContent: 'space-evenly',
    alignItems: 'center',
    height: '60vh',
    marginTop: '20px',
  },
  logo: {
    width: '50px',
    height: '50px',
    borderRadius: '50%',
    filter: 'grayscale(100%)',
    cursor: 'pointer',
    transition: 'filter 0.3s',
  },
  envelopeContainer: {
    position: 'absolute',
    top: '70%',
    left: '50%',
    transform: 'translateX(-50%)',
    display: 'flex',
    justifyContent: 'center',
    width: '100%',
    height: '30vh',
  },
  envelope: {
    fontSize: '2.5rem',
    cursor: 'pointer',
    position: 'absolute',
    transition: 'transform 0.2s ease',
  },
  jokeBox: {
    position: 'absolute',
    top: '-60px',
    left: '50%',
    transform: 'translateX(-50%)',
    backgroundColor: '#333',
    color: '#fff',
    padding: '10px 15px',
    borderRadius: '10px',
    fontSize: '1rem',
    whiteSpace: 'nowrap',
    opacity: 0,
    pointerEvents: 'none',
    transition: 'opacity 0.3s ease',
    textAlign: 'center',
    boxShadow: '0 4px 8px rgba(0, 0, 0, 0.2)',
  },
  footerContainer: {
    position: 'absolute',
    bottom: '0',
    left: '50%',
    transform: 'translateX(-50%)',
    display: 'flex',
    justifyContent: 'space-evenly',
    width: '100%',
    padding: '1rem 0',
    fontSize: '1rem',
    color: '#aaa',
    borderTop: '1px solid #333', // Optional border for separation
  },
  footerText: {
    textDecoration: 'underline',
  },
  smallText: {
    fontSize: '0.8rem',
    color: '#777',
    marginTop: '1rem',
    textAlign: 'center', // Center the "Thanks for visiting" text
    marginBottom: '1rem', // Give some space between the footer text and this line
  },
};

const Portfolio = () => {
  const jokes = [
    "Why do programmers prefer dark mode? Because light attracts bugs!",
    "Why do Java developers wear glasses? Because they can't C#!",
    "I told my computer I needed a break, and now it wonâ€™t stop sending me KitKats.",
    "Why did the developer go broke? Because they used up all their cache!",
    "How do full-stack devs describe themselves? As 'in-divisible' units!",
    "Whatâ€™s a programmerâ€™s favorite type of music? Algo-rhythm!",
  ];

  const generateRandomPositions = () =>
    Array.from({ length: jokes.length }, () => ({
      top: `${Math.random() * 6 + 5}%`,
      left: `${Math.random() * 30 + 35}%`,
    }));

  const [positions, setPositions] = useState(generateRandomPositions);

  useEffect(() => {
    const handleResize = () => setPositions(generateRandomPositions());
    window.addEventListener('resize', handleResize);

    return () => window.removeEventListener('resize', handleResize);
  }, []);

  const handleMouseEnter = (e) => {
    const jokeElement = e.target.querySelector('.joke-box');
    jokeElement.style.opacity = 1;
  };

  const handleMouseLeave = (e) => {
    const jokeElement = e.target.querySelector('.joke-box');
    jokeElement.style.opacity = 0;
  };

  return (
    <div style={{ position: 'relative' }}>
      <div style={styles.mainContent}>
        <h1>Contact Me</h1>

        {/* Social Media Links */}
        <div style={styles.logoContainer}>
          {[
            { href: 'https://www.linkedin.com/in/mohammed-bakhshi/', imgSrc: linkedin, alt: 'LinkedIn' },
            { href: 'https://github.com/Mohammed-Bakhshi', imgSrc: github, alt: 'GitHub' },
            { href: 'https://www.facebook.com/mohammed.bakhshi/', imgSrc: facebook, alt: 'Facebook' },
            { href: 'https://instagram.com/mohammedbakhshi/', imgSrc: instagram, alt: 'Instagram' },
            { href: 'mailto:mohammedbakhshi@hotmail.com', imgSrc: email, alt: 'Email' },
          ].map(({ href, imgSrc, alt }) => (
            <a key={alt} href={href} target="_blank" rel="noopener noreferrer">
              <img
                src={imgSrc}
                alt={alt}
                style={styles.logo}
                onMouseEnter={(e) => (e.target.style.filter = 'grayscale(0%)')}
                onMouseLeave={(e) => (e.target.style.filter = 'grayscale(100%)')}
              />
            </a>
          ))}
        </div>

        {/* Jokes Section */}
        <div style={styles.envelopeContainer}>
          {jokes.map((joke, index) => (
            <span
              key={index}
              style={{ ...styles.envelope, ...positions[index] }}
              onMouseEnter={handleMouseEnter}
              onMouseLeave={handleMouseLeave}
            >
              ðŸ“©
              <span className="joke-box" style={styles.jokeBox}>{joke}</span>
            </span>
          ))}
        </div>
      </div>

      {/* Footer Section */}
      <div style={styles.footerContainer}>
        <div style={styles.footerText}>Made with React.js</div>
        <div style={styles.footerText}>Running on AWS</div>
        <div style={styles.footerText}>Powered by Nginx</div>
      </div>

      <div style={styles.smallText}>Thanks for visiting</div>
    </div>
  );
};

export default Portfolio;
